import "../../App.css";

import "./header.css";
import React from "react";
import Login from "../authorization/login";
import { ModuleLogin } from "../module/modules";
const Header = () => {
  return (
    <>
      <header>
        <div className="container">
          <div className="header_inner">
            <div className="main">
              <ol>
                <li>
                  <a href="#">Students</a>
                </li>
                <li>
                  <a href="#">Employers</a>
                </li>
              </ol>
            </div>
            <div className="auth">
              <ol>
                <li>
                  <a href="#">Log In</a>
                </li>
                <li>
                  <a href="#">Sign Up</a>
                </li>
              </ol>
            </div>
          </div>
        </div>
      </header>
      <ModuleLogin/>
    </>
  );
};

export default Header;
